@-moz-document url-prefix("http://ikleerdigitaal.nl/") {
BODY {
    background-color: #ff00d2 !important;
    font-family: Arial, sans-serif;
    padding: 5px 5px;
    margin: 0px;
}

TD.navibar {
    padding: 15px 5px;
    margin: 0px;
    background: #ff00d2;
    color: #00ff99;
}

.tableCal {
    font-family: Verdana;
    font-size: 11px;
    color: #00ff99;
    font-weight: normal;
    background: #ff00d2;
}
TABLE.pagepath {
    background: #ff00d2;
    margin: 0px;
    padding: 5px;
    color: #00ff99;
    font-size: 140%;
    width: 100%;
}
TABLE.headersec TD.text {
    width: 99%;
    font-size: 140%;
    font-weight: bold;
    color: #00ff99;
}
P.footer {
    margin: 0px;
    padding: 0px;
    font-weight: bold;
    font-size: 8px;
    text-align: center;
    color: #ff00d2;
}
TABLE.list TD {
    background: #ff00d2;
}
TABLE.cs TABLE.progress TABLE.fill {
    background: #2100ff;
}
TABLE.cs TABLE.progress {
    width: 50px;
    border: 1px solid #0006ff;
}
}
